import React from "react";

class HeaderComponent extends React.Component {
    render() {
        return(
            <header>
                <ul>
                    <li>메뉴1</li>
                    <li>메뉴2</li>
                    <li>메뉴3</li>
                </ul>
            </header>
        );
    };
}

export default HeaderComponent;
